import React from "react";

const ExpenseForm = () => {
  return (
    <div>
      <form>
        <div>
          <input type="text" />
          <label>Title</label>
        </div>
        <div>
          <input type="Date" />
          <label>Date</label>
        </div>
        <div>
          <input type="number" />
          <label>Amount</label>
        </div>
      </form>
    </div>
  );
};

export default ExpenseForm;
